INSERT INTO `customer_stories` VALUES (1,'Susan - Vienna, Virginia','My 9-year-old has always loved puzzles, but as heâ€™s gotten older, the puzzles that are mass-marketed didnâ€™t really provide him with much of a challenge.  The puzzles with hundreds of pieces took him too long to finish and he would lose interest.  As a result, he hasnâ€™t played with puzzles for years and I wasnâ€™t certain that he would  find the MyDaddyPuzzles fun to do.  It was with a bit of trepidation that I gave him a MyDaddyPuzzle to test out.  I thought the simple 10-piece puzzle would probably bore him quickly.  But as he started to try to fit the pieces together, he became more engrossed.  The unique shapes of the puzzle and the puzzle pieces presented him with enough of a challenge that when he finished the puzzle, he looked up and said, â€œCan we get another one?â€  He got his wish!',1,'2007-07-17 17:20:56','2007-07-17 17:20:57'),(2,'Stephanie - Alexandria, Virginia','My daughter recieved a MyDaddyPuzzle as a gift for her third birthday. She loves her frog--and so does the rest of our family! It is a beautiful, quality, handmade (in the USA!) product that we absolutely love. THANKS!\r\n',1,'2007-09-12 13:41:31','2007-09-12 13:42:01'),(3,'Camdon - Kuna, Idaho (Age 9)','I have a Camden Camel puzzle.  I chose Camden because my name is Camdon. I asked for an unfinished puzzle because I wanted to decorate it myself.  I\'ve had a lot of fun painting it and making it look just like I want.  At first, I thought it would be easy to put the puzzle together.  I was wrong.  It took me nearly a minute to get it all put together.  It was fun to figure out.  I can\'t wait to see more of these puzzles.',1,'2007-09-21 14:06:00','2007-10-03 16:35:49'),(4,'Jenny - Quantico, Virginia','These puzzles are beautiful!  My little boy has the colored frog, it almost looks more like art than a child\'s toy. I especially love the stain which allows the grain of the wood to be seen and adds to the beauty and uniqueness of the toy. The puzzles also vary in complexity which make them fun for all ages. My little fella is 1 1/2 years old loves his frog.  I have a four year old niece who will be getting the Lion, and the difficulty of that puzzle will challenge her. For me I love to see how the pieces are designed. Online images do not do these beautiful toys justice. Thanks My Daddy Puzzles. ',1,'2007-10-03 16:18:15','2007-10-03 16:18:15');
