INSERT INTO `email_messages` VALUES (7,'justinbkay@gmail.com','testing on slicehost','Ryan, let me know if you get this.  I\'m sending from the new slicehost account.\r\n\r\njustin','Justin'),(8,'stephanie@mnspublicity.com','LOVE YOUR PUZZLES!','My daughter recieved a MyDaddyPuzzle as a gift for her third birthday. She loves her frog--and so does the rest of our family! It is a beautiful, quality handmade (in the USA!) product that we absolutely love. THANKS!','Stephanie Marshall'),(9,'pmiller1806@comcast.net','address for A Show of Hands','Since you didn\'t fill out that one form, I don\'t have your address or phone or email.  Can you sendme this info so I can put you in our computer?\r\n\r\nTHANKS!!!\r\n\r\nPat at A Show of HaNDS','Pat Miller'),(10,'naostmoe@stkate.edu','Hello From Minnesota','Hi Ryan, Noelle and Family,\r\n\r\nI am sitting here in Minnesota with your Aunt Tessa.  She showed me your great puzzles. WOW!, they are very cool (just like I remember you to be Ryan). I will have to order that fish for a little friend of mine who is 15 months old.  It looks like a perfect Christmas gift for a Minnesota boy.\r\n\r\nRyan, I remember all of our fun times together in Minnesota and Idaho.  Great memories!!  \r\n\r\nIt looks like you have a wonderful family and job.  I am so proud of you.  Hope I get an opportunity to see all of you someday soon.\r\n\r\nTake care,\r\n\r\nNancy O.','Nancy Ostmoe'),(11,'sandirap@hotmail.com','broken puzzle piece','Hi, My husband and I bought the multicolored orca puzzle from you today (Sunday Dec. 2, 2007) at the Maryland Christmas show in Frederick,  for our 3 year old little boy who was with us.  You told us to not drop the puzzle on the concrete that some of the puzzle pieces are thin in places and it could break.  We got all the way home and were putting the puzzle together once before bedtime and then put it back in the bag and dropped it on the CARPET and the larger piece that holds the tail on broke in two places on either side of the tail joint.  Would it be possible to get a replacement piece for it?  $25.00 is alot to spend on something you get to play with once and it breaks.  And breaks a 3 year olds heart too.  We\'ll pay for the piece if necessary.\r\n\r\nThank you, \r\nSandi Rapczynski\r\n(301)932-0091   ','sandi rapczynski'),(12,'jonp@slprod.com','Craft Show Invitation','Hi there.  I visited your booth at the MD Christmas Show and thought you would be a good fit for our March and October events.  The MD Spring Craft Show and the MD Holiday Craft Show.\r\nI look forward to hearing from you.\r\n\r\nJon Plummer\r\nS&L Productions, Inc.\r\n888-532-3669\r\nwww.slprod.com','Jon Plummer'),(13,'dganders@netzero.net','Christmas Newsletter','When I received your Christmas newsletter, I was excited to hear that you have started your own business.  I went online right away to see what \"MyDaddyPuzzles\" was all about, and was amazed at the quality of your product! I wish I would have known about it sooner, or I would have ordered these for all of my nephews for Christmas.  I ordered one for my daughter, and one for my nephew\'s birthday that is coming up in February.  I look forward to receiving them.  I\'ll definitely be getting them for birthday gifts this year.  I\'m sure excited for you guys!! What a great idea!!','Kimberly Anderson'),(14,'kamiesorensen01@peoplepc.com','You guys ROCK!!','I am so proud of my friends--what a flippin\' cool idea and puzzles are one of my favorite things.  Don\'t worry, Ryan, we\'ll be making our purchase shortly.  Oh, and my e-mail address isn\'t right, but it wouldn\'t let me leave Cory\'s in there.','Kamie Sorensen'),(15,'bsg0704@aol.com','Puzzle Chaos','I purchased a puzzle for my grandaughter\'s Christmas.  As soon as she oppened it and starting playing one of the pieces broke.  Will you replace it?  Of course, to complicate the situation she wants the Butterfly instead of the one I chose.  Thanks','Brenda S. Grisham'),(16,'info@downtoearthtoys.com','Your puzzles','Greetings!\r\n\r\nI love your website!  I just wanted to check in and ask if you might be accepting new wholesale accounts in 2008?  I would love to be able to add your puzzles to my Made in USA catalog!  You can take a look at my site and let me know what you think....www.DownToEarthToys.com\r\n\r\nThanks!\r\nCarrin Weirauch\r\nOwner, Down To Earth Trading Co., LLC\r\ndba Down To Earth Toys','Carrin Weirauch'),(17,'jonp@slprod.com','Craft Shows - Timonium MD Fairgrounds','Hi there.  I\'ve seen you at a local event and thought you\'d be a great fit in our shows. Our spring show is in March and the fall event is in October.  For more information, go to www.slprod.com or call 888-532-3669.\r\n\r\nJon Plummer\r\nS&L Productions, Inc.','Jon Plummer'),(18,'kimdung_hxcraft@yahoo.com.vn','offer 3D wooden puzzle','Hi,\r\nThank you very much because you had devoted half a time in order to refer them.\r\n \r\nWe can make according to your requirements about colour, size and model. And we can accept order froms with small quantity (1000pc and over)\r\n \r\nDo not hesitate to send me with quantity which you need. I am very happy to cooperate with you.\r\nThank you, you have read my mail.\r\n \r\nI wait for your answer.\r\nyour faithfully,\r\n \r\nThanh Thanh\r\n ','Thanh'),(19,'jenuinern@hotmail.com','Raffle Puzzle','Hello!  Your puzzles are beautiful!  I came across this site after seeing one of your puzzles on DownToEarthToys.com.  I am interested in purchasing one, but have also entered the drawing for a free puzzle.  Just out of curiosity, which puzzle is being raffled off this month?  Thank you for making such beautiful, engaging toys!  We will definitely be back!\r\n\r\nThanks--Jennifer Todorov','Jennifer Todorov'),(20,'info@willowtreetoys.com','wholesale inquiry','Hello,\r\n\r\nWe would like to carry your puzzles in our store.  Can you provide us with your wholesale pricing?  Our address is:\r\n\r\nWillow Tree Toys\r\n61540 American Lane, Suite 140\r\nBend, OR 97702\r\n\r\nThank you.\r\n\r\nKim Semancik\r\nWillow Tree Toys','Kim Semancik'),(21,'zhlgmj@bluvdq.com','ABnhbFMXCwXev','mvvH55  <a href=\"http://wvyyisevcetw.com/\">wvyyisevcetw</a>, [url=http://yrnhogngzvak.com/]yrnhogngzvak[/url], [link=http://mhdhgbtxzigy.com/]mhdhgbtxzigy[/link], http://zhazjsxoazah.com/','kqpoipu'),(22,'o-tako@hotmail.com','o-tako@hotmail.com','how do you get such great ideas.i have a three and half year old grandson and he likes cardboard puzzles but yours are so much better and will last much longer great stuff','steven k carvalho'),(23,'samantha@notyouraveragebabyshop.com','Carrying MyDaddyPuzzles in my shop?','Hiya,\r\n\r\nGorgeous, gorgeous work! I would love to carry some of your puzzles in my online baby (actually baby/child!) shop (nearly ready to launch). Can you please let me know what your wholesale terms are? Thanks so much; I look forward to hearing back from you!  :)\r\n\r\nSamantha','Samantha Smith'),(24,'armine100@cox.net','necklace for your mom in exchange your puzzle','Hi, I did not have time to come to your booth. I hope you did well. You can return the necklace or mail the check if you want to keep it to 3035 Beechwood Lane , Falls Church VA, 22042, to Armine Yergat.\r\n','Armine Yergat'),(25,'nancyhund@adelphia.net','other options','Hi:\r\n Kristy Meagher my friend and neighbor showed me a couple of your puzzles. They are fantastic.\r\n You are a gold mine in the making!!!\r\n I tutor children with autism and would love to give these as Birthday gifts.\r\n Would you make Giraffes and Dinosaures?\r\nThanks Nancy','Nancy Hund'),(26,'sarah.schultz@shelterhouse.org','Puzzles etc.','I met you on Saturday at Mclean Day, we had the booth close to yours.  I work for Shelter House, Inc. we have two homeless shelters for families in Fairfax, VA.  I wondered if you might have puzzles with small flaws that you would not be able to retail but that we might be able to have the children play with in our shelters.  We would be more than happy to give you free publicity for your donation.  If you would like to talk further you can reach me at 703-536-5383, thanks for considering my request!  Best,  Sarah','Sarah Schultz'),(27,'ejefield16@comcast.net','Dragon puzzle','Hello,\r\nWe purchased two of your puzzles for our twin grandchildren at Viva Vienna last weekend, and they have already been dis- and reassembled several times.  We saw the dragon prototype and would be interested in buying the finished product for another grandchild, who is half Chinese.  I will be visiting her in Shanghai leaving June 24 and would love to take the puzzle if it is available in time, or buy it for a future gift if it is not.','Liz Field'),(28,'sean@expo4greatkids.com','Great Kids Expo','Hello,\r\n\r\nOne of my business partners stopped by your booth last weekend at Viva Vienna.  My company is producing the Great Kids Expo October 25 and 26 at the Dulles Expo Center in Chantilly.  I think this would be a great opportunity and market for MyDaddyPuzzles.  I would simply like to get you some more information about the event.  If you are interested in learning more, please send me an e-mail to sean@expo4greatkids.com with your contact information so that I can e-mail you some additional information.\r\n\r\nThanks in advance for your time.  I hope to hear from you soon!\r\n\r\nSincerely,\r\nSean Sullivan\r\nPartner\r\nGreat Kids Expo\r\nwww.expo4greatkids.com\r\nsean@expo4greatkids.com','Sean Sullivan'),(29,'nlblair@pacbell.net','Wholesale info','Hi:\r\n\r\nI have a kid\'s business and was considering carrying your products.  Can you provide me without wholesale pricing, terms and.or access to wholesale catalogue,\r\n\r\nThanks\r\nNancy Blair\r\nKidz Kupboard','Nancy Blair'),(30,'lisa@suffolkfest.org','Suffolk Peanut Fest','Dear MyDaddyPuzzles,\r\n\r\nOur Director was at Celebrate Fairfax this past weekend and loved your puzzles and thought you would do well exhibiting at our festival in October. So, I was wondering if you could send me your mailing address and I will mail you an exhibitors application.\r\n\r\nI look forward  to hearing from you.\r\n\r\nLisa Key','Lisa Key'),(31,'angelawessling@hotmail.com','Extreme Home Makeover - Donate Services Request','Hi,\r\nI saw your work Saturday at Art in the Park. That evening I was asked by EHM to make four signs to go over four girls beds for their first episode of season six. I think it would be fun to make the signs into puzzles. Now they are slated as simply wood with painting on them. If you are interested and can act quickly enough (we would have to finish by Thursday night) then I will talk to the Design Producer about the idea and work up the lines for the puzzles. It is a cheerleader / dance theme. Please call me at 571-274-1811 to discuss. It would be for the season 6 episode 1.\r\nAngela Wessling','Angela Wessling'),(32,'contact@l-s-q.com','Pick up instead of shipping','Hi.\r\n\r\nIs it possible to pickup the puzzles, instead of having them shipped? I am local. Mount Vernon area.\r\n\r\nLove your puzzles!\r\n\r\nShadi\r\n\r\n','Shadi'),(33,'memerli7@aol.com','Vendor Invitation, Park Your Arts 2008','Hi Mr. Lamb\r\n\r\nI volunteer on the arts committee for Park Your Arts, and I wanted to let you know that we still have some spaces available on September 7th. There will be a maximum of 30 artists and I expect it to be a good show. The setting in Upper Marlboro is very pleasant, and I think having the library booksale at the same time brings a lot of families (and customers) out to the event.\r\n\r\nI would like to attach a copy of the application, the guidelines, and a PDF file that shows the postcards we will be giving to the artists so they can let their customers know about the show, but I don\'t know how in this format. Please email me and I can get these to you. Spaces will be 10\'x15\'. You can access www.parkyourarts.com also.\r\n\r\nI hope you will be able to exhibit at Park Your Arts this year - we\'d love to have you join us in Upper Marlboro. I\'ve seen your puzzles and they are great. Please don\'t hesitate to contact me if you have questions!\r\n\r\nMary Ellen Merlino\r\nELYSIUM Unique Jewelry and Wearable Art\r\n301 627-7590\r\nmemerli7aol.com\r\n','Mary Ellen Merlino'),(34,'jvolpe@cox.net','Sales ','I spoke with you at Viva Vienna , end of May. Really liked your craft. Vienna Woman\'s Club has a\r\nHoliday Bazaar on November 8th at the Community Center. You rent space (3 sizes avail.) If you\'re\r\ninterested and want more information, I can get it to you if you have an email address.\r\n\r\nThanks,\r\nNancy Volpe, Chair','Nancy Volpe'),(35,'development@olgcva.org','Holiday marketplace','Hi.  I saw your booth at ViVa Vienna and loved your stuff.  Would you be interested in participating in a small-ish (about 50 vendors) holiday/craft show at a church in Vienna VA on 12/6 and 12/7?  If yes, could you supply an e-mail address (and/or snail mail) where I could send an application form and other materials?  If you\'re not available, would you be interested in being kept on my mailing list for next year?  If you\'re just not interested, I would appreciate a response anyway.  Thanks!','Patrice Roe'),(36,'burke_bridget13@hotmail.com','Festival & questions','Hello,\r\n\r\nMy name is Bridget Burke and I\'m Co-Chairperson of the 18th Annual Poolesville Day Celebration in Poolesville, MD (Montgomery County).  \r\n\r\nI am looking for new, creative & unique craft vendors for our festival and saw your puzzles & website.  I LOVE them and wanted to know if you would be interested in participating in our festial on Saturday, September 20th?!  I know our patrons are craving for a vendor like you!\r\n\r\nIf you are interested, please contact me and we can talk further.  In the meantime, please visit our website to get a feel for our festival www.poolesvilleday.com.\r\n\r\nThank you and I look forward to hearing from you,\r\n\r\nBridget Burke\r\nCo-Chairperson\r\nPoolesville Day Committee, Inc.\r\n18th Annual Poolesville Day Celebration\r\ncell) 240-483-3276\r\npoolesvilleday@yahoo.com\r\nburke_bridget13@hotmail.com\r\nwww.poolesvilleday.com\r\n\r\n','Bridget Burke'),(37,'Kerry@cameronperks.com','We\'d like for you to show with us again! especiallyat christmas!! ',' I hope you remember me from Cameron Station\'s \"Art in the Park\" show in\r\nJune -- many of our customers certainly remember you. If I recall, you\r\nwere positioned about midway down the median in a slightly shady area, and did fairly well.\r\n\r\nCameon Station is planning a similar but very scaled-down arts and crafts\r\nevent (only 20 vendors) in late September as part of a larger three-day\r\ncelebration of the ten year anniversary of Cameron Station as a community.\r\nI would really love it if you could be a part of that. \r\n\r\nI would be even more thrilled if you could participate in our \"Christmas Village\" event, scheduled for sometime in late November or early December. \"Christmas Village\" is a long-standing tradition in Europe, which has made its way to NYC, and ever so gradually, to Cameron Station (grin). So, it\'s still in the planning stages. I envision hot chocolate available at the gazebo, toys for moms and dads to get for little ones, and vice versa, etc. Since we\'ll have this event fairly early in the season, I know you could do well so many parents, grandparents, aunts (like me) uncles, etc., on the lookout for a unique gift, handmade to boot. I also welcome any ideas you may have (or have seen) about such an event.\r\n\r\nI can\'t tell you how many people commented to me that they thought your things were perfect for younger kids playing with developmental toys, and I\'m sure you realize how many folkd in that community are interested in that kind of thing. I personally love your stuff, wish my little nephews were younger. I do have young neices -- under age two. How young is too young? And not to reinforce gender roles, but no little kitties or bunnies? Maybe I didn\'t see them! \r\n\r\nI relly hope to see you folks again.\r\n\r\nPlease contact me if you\'d like an application for the September Art in the Park. The fee for that is $35, and it runs from 9-1. Please call or email with any questiosn you have at all. Thanks! \r\n--Kerry \r\n\r\n\r\n\r\nKerry Flynn\r\nMarketing Manager\r\nCameron Perks CoffeeHouse\r\nKerry@Cameronperks.com\r\ncell 202.270.4883','Kerry Flynn'),(38,'mbroadnax@townofhaymarket.org','20th Annual Haymarket Day - 2008','Good morning,\r\n \r\nWe are gearing up for our 20th Annual Haymarket Day and would like you to be a part.\r\n \r\nThis event will take place on Saturday, September 20th from 9am to 4pm.  \r\n \r\nThere will be a Parade beginning at 10am.  \r\n \r\nWe will have wine tasting, crafters, commercial and non-profit businesses, food, live music, masses of people from near and far and loads of fun filled activities for the children.  \r\n \r\nFill free to visit our website @ www.townofhaymarket.org to view photos from last year and any other pertinent information.  \r\nClick on Calendar; Haymarket Day and scroll down.  The forms for Parade and / or Vendor participation are located there.  Or you may contact our office with any questions or concerns you might have.\r\n \r\nThank you in advance for your support and participation.\r\n \r\n \r\nMittie M.Broadnax\r\nAdmin Assistant\r\n703-753-2600 â€“ office\r\n703-753-2800 - fax\r\nwww.townofhaymarket.org\r\n','Mittie M. Broadnax'),(39,'shanyna@comcast.net','Great Kids Expo','Please contact me so we can talk about you participating in the Great Kids Expo that\'s coming to the Dulles Expo Center in October. \r\n\r\nHere is the website-- I hope to see you there!\r\nwww.expo4greatkids.com','shanyn'),(40,'jvolpe@cox.net','Holiday Bazaar in Vienna','I met you at Viva Vienna and picked up your card.\r\nThe wooden puzzles were very attractive and reasonably priced I thought.\r\nVienna Woman\'s Club is having its\' 48th Holiday \r\nBazaar on Sat. Nov. 8th at the Vienna Community Center . I\'d love to have you take part. Spaces are available and rent according to size ie: $60\r\nfor 5\'x6\' or $75 for 5\'x8\'. Tables can be rented for $10 or you can bring your own.\r\nI can email you an application if you\'d like one.\r\n\r\nNancy Volpe 703-938-7716 Bazaar Chair','Nancy Volpe'),(41,'susie622@yahoo.com','Timmy T-Rex','Hi:  Just wanted to send you a quick note to let you know that my son loves his \"dinosaur puzzle\" as he calls it.. It was great meeting you at the Arlington County Fair, keep up the good work!','Susana');
