INSERT INTO `news_stories` VALUES (1,'Art on the Green (4/27/2008)','MyDaddyPuzzles joined hundreds of people at the rainy yet fun Art on the Green event at the <a href=\"http://www.acps.k12.va.us/tcw/expo.php\">Titan Expo 2008</a>.  Mother Nature didn\'t cooperate very much but many people still had a lot of fun at T.C. Williams High School in Alexandria.  All proceeds from entry fees and concessions went to the T.C. Williams Scholarship Fund.  This is a great event and we hope to participate again next year.  Hopefully mother nature will cooperate a bit more and give us more sunshine that raindrops.  If you have any questions about next year\'s Art on the Green contact the chairperson of the event visit the <a href=\"http://www.acps.k12.va.us/tcw/expo.php\">Titan Expo 2008 Website</a>.','titan-expo.jpg','2008-04-27','2008-04-28 15:18:14','2008-04-28 16:26:25'),(2,'Upcoming Events (4/28/2008)','MyDaddPuzzles is happy to announce a parital schedule of 2008 events.<br>\r\nMay 10 & 11 - <a href=\"http://www.alexandriavolunteerbureau.org/index.html\">Old Town Fine Arts Festival</a><br>\r\nMay 17 - <a href=\"http://www.mclearncenter.org\">McLean Day Festival</a><br>\r\nMay 25 & 26 - <a href=\"www.vivavienna.org\">Viva Vienna</a><br>\r\nJune 6-8 - <a href=\"http://www.celebratefairfax.com\">Celebrate Fairfax Festival</a><br>\r\n\r\n\r\nJuly 12 & 13 - <a href=\"http://www.restonfestival.com\">The Reston Festival</a><br>\r\nOctober 4 - <a href=\"http://www.artontheavenue.org\">Art on the Avenue</a><br/>\r\n\r\nWe\'ve looked all around the area for the best places to show and sell our toys.  These dates are subject to change so please check back often.  We\'re also hoping to add more shows to the calendar in the next couple of weeks.  We hope to see you soon at one of these fine venues.\r\n\r\n\r\n\r\n','2008 calendar.jpg','2008-04-28','2008-04-28 15:35:31','2008-05-01 02:27:06'),(3,'Down to Earth Toys (1/20/2008)','MyDaddyPuzzles is happy to announce an wholesale agreement with <a href=\"http://www.downtoearthtoys.com\">Down to Earth Toys</a>.  Down to Earth Toys sprecializes in US made, wooden and natural toys.  90% of the toys sold at Down to Earth Toys are made in the United States.  Their hope is to stimulate America\'s ecomony and help the consumer know that theyr money is going directly back in the pockets of American workers.\r\n\r\n<p>A limited section of our puzzles are available at Down to Earth Toys.  We recommend their products and encourage you to shop there.','down to earth toys.jpg','2008-01-20','2008-04-28 15:46:00','2008-04-28 15:55:48'),(4,'MyDaddyPuzzles Available at A Show of Hands (10/13/2007)','We are proud to announce that MyDaddyPuzzles will now be available for purchase in the historic Del Ray neighborhood of Alexandria at <a href=\"http://www.ashowofhands.biz\" target=\"_blank\">A Show of Hands</a>\r\nSince 2005, A Show of hands has worked to represent the diversity of local artists by providing them with a venue to showcase and sell their work. All items are unique and handcrafted and the shop has quickly become the place to get a one-of-a-kind gift \r\n\r\n<p>A Show of Hands will offer up 23 of our puzzle designs for sale among their other wonderful locally made items.  We are very pleased to have our work showcased this popular Alexandria shop located on historc Mount Vernon Avenue.  To see hours of operation visit A Show of Hands website at <a href=\"http://www.ashowofhands.biz\" target=\"_blank\">www.ashowofhands.biz</a>','a_show_of_hands.jpg','2007-10-13','2008-04-28 15:53:21','2008-04-28 15:54:29'),(5,'MyDaddyPuzzles Now Available at Monday\'s Child (12/15/2007)','<a href=\"http://www.mondayschildofalexandria\">Monday\'s Child</a>, located at 218 Lee Street in Old Town Alexandria, is the latest local business to carry MyDaddyPuzzles.  \"Monday\'s child is fair of face, Tuesday\'s child is full of graceâ€¦\" goes the delightful verse that gave this lovely little children\'s clothing shop its name. Tucked among the charming shops at historic Crilley Warehouse in Old Town Alexandria, Monday\'s Child offers classic, impeccably-made apparel that never goes out of style.  At Monday\'s Child, you\'ll find precious dresses and outfits recalling a gentler age when children looked like children, and the tiniest details mattered: hand smocking, fine embroidery, quality fabrics, and exceptional finishing.  We\'re proud to add our puzzles to the exceptional products available at Monday\'s Child.  Visit <a href=\"http://www.mondayschildofalexandria\">www.mondayschildofalexandria.com</a> for more information.','mondays child.jpg','2007-12-15','2008-04-28 16:04:19','2008-04-28 16:05:57'),(6,'Art on the Avenue 2007 (10/6/2007)','Thank you for making Art on the Avenue a wonderful success.  We had a great time talking with all of you and telling you about our puzzle.s  More than 40,000 people attended this year\'s festival and enjoyed a beautiful day on Mount Vernon Avenue in the Del Ray neighborhood of Alexandria.  This was our very first event selling puzzles and it certainly got us off on the right foot.  To those who bought our puzzles, ENJOY!.  To everyone else who stopped to chat and look things over, we hope to see you again very soon.  We\'ll be back next year for the 13th Annual Art on the Avenune which will specifically celebrate the 100th Anniversary of the Potomac West area.  ','art_on_the_avenue_logo small.jpg','2007-10-07','2008-04-28 16:25:40','2008-04-28 16:57:59'),(7,'Maryland Christmas Show (12/2/2007)','MyDaddyPuzzles will take part in the <a href=\"www.marylandchristmasshow.com\">Maryland Christmas Show</a> November 30th, December 1st and 2nd.  According to the show\'s website, \"Nothing brings back the yuletide spirit quite like the Maryland Christmas Show. For the 25th season visitors from near and far will discover the joys of shopping at Maryland\'s premier Christmas event. The Maryland Christmas Show, located in historic Frederick City, brings together many fine artisans and merchants to make your holiday shopping an enjoyable event.\"  \r\n<p>  We\'re happy to be involved in this event and hope to see you all there.  For more information on the Maryland Christmas Show, visit <a href=\"www.marylandchristmasshow.com\">www.marylandchristmashow.com</a>.\r\n ','md christmas show.jpg','2007-11-28','2008-04-28 16:45:28','2008-04-28 16:45:28'),(8,'March Drawing Winner (4/1/2008)','Congratulations to Jennifer T. from Louisville, Kentucky.  Jennifer was the winner of the March Puzzle give-away.  Jennifer won a free Danny Duckling - Fun Colors.  Congratulations, Jennifer, we hope you enjoy your puzzle.  To register for next month\'s drawing, click <a href=\"http://mydaddypuzzles.com/puzzle/give_away\">here</a>.','duckling_colored_thumb.jpg','2008-04-01','2008-04-28 16:54:01','2008-05-05 22:58:04'),(9,'February Drawing Winner (3/1/2008)','Congratulations to Camdon K. from Kuna, Idaho.  Camdon was the winner of the February Puzzle give-away.  Camdon won a free Danny Duckling - Fun Colors.  Congratulations, Camdon, we hope you enjoy your puzzle.  To register for next month\'s drawing, click <a href=\"http://mydaddypuzzles.com/puzzle/give_away\">here</a>.','duckling_colored_thumb.jpg','2008-03-01','2008-04-28 16:56:43','2008-04-28 16:59:48'),(10,'A Show of Hands Trunk Show (2/2/2008)','Join Ryan at <a href=\"http://www.ashowofhands.biz\">A Show of Hands</a> on Saturday, February 2nd from 11:00 am until 4:00 pm.  Ryan will be in the store to show his hand crafted puzzles.  He\'ll also show how he creates and makes each puzzle.  To see the news release from A Show of Hands, click <a href=\"http://www.ashowofhands.biz/Site/Trunk_Show_Febrary_2008.html\">here</a>.\r\n\r\n<p>PS - This was a great event.  I had a wonderful time talking with all the folks who stopped by the shop.  What a great activity!  If you didn\'t make it to this Trunk show, be sure to check out the next one.  ','trunk show.jpg','2008-02-02','2008-04-28 17:06:46','2008-04-28 17:07:40'),(11,'Playing with Puzzles Develops Problem Solving & Critical Thinking Skills','<a href=\"http://www.mentalhelp.net\">MentalHelp.net</a> published an article on January 16th, 2008 titled <a href=\"http://www.mentalhelp.net/poc/view_doc.php?type=doc&id=14342&cn=462\">Cognitive Nurturing in Early Childhood</a>.  The article was written by Angela Oswalt, MSW, Natalie Staats Reiss, Ph.D and Mark Dombeck, Ph.D.  In the article, the authors stated, \"Age-appropriate puzzles are fun challenges that encourage problem-solving and critical thinking skills.\"  They also suggest that playing with puzzles help a child develop categorization, concentration, and memory skills.  The authors also suggested many other ways to help your child develop critical thinking skills.  To read the full article click <a href=\"http://www.mentalhelp.net/poc/view_doc.php?type=doc&id=14342&cn=462\">here</a>.','mentalhelpnetlogo_puzzle2.jpg','2008-04-30','2008-04-30 20:11:41','2008-05-01 01:46:55'),(12,'National Association for the Education of Young Children says Puzzles Help Children Develop Crucial Skills','<a href=\"http://www.naeyc.org\">The National Association for the Education of Young Children</a> published an article titled <a href=\"http://www.naeyc.org/ece/1997/17.asp\">Puzzles in early childhood education: Putting the pieces together</a>.  In the article, the uncredited author suggests that \"puzzles help children build the skills they need to read, write, solve problems, and coordinate their thoughts and actionsâ€”all of which they will use in school and beyond.\"  The author also suggests that a child\'s motor skills are developed by playing with puzzles.  \"By inserting pieces into the puzzle, children also develop the muscle group used for writing, or the \"pincer\" grasp.\"  To read the full article, click <a href=\"http://www.naeyc.org/ece/1997/17.asp\">here</a>.','naeyc.gif','2008-04-30','2008-04-30 20:45:15','2008-05-01 01:46:44'),(13,'April Drawing Winner (4/1/2008)','Congratulations to Shelli W. from Royal City, Washington.  Shelli was the winner of the April Puzzle give-away.  Shelli won a free Camden Camel - Natural Stains.  Congratulations, Shelli, we hope you enjoy your puzzle.  To register for next month\'s drawing, click <a href=\"http://mydaddypuzzles.com/puzzle/give_away\">here</a>.','camel_stained_thumb.jpg','2008-05-01','2008-05-05 22:57:53','2008-05-06 13:49:52'),(14,'Old Town Alexandria Arts & Crafts Festival (5/10/2008)','MyDaddyPuzzles is at the Old Town Arts & Crafts and Volunteer Festival on Saturday, May 10th and Sunday, May 11th.  The Festival is sponsored by the <a href=\"http://www.alexandriavolunteerbureau.org\">Alexandria Volunteer Bureau</a> and is held in <a href=\"http://pages.alexandriacity.com/MarketSquare.htm\">Market Square</a> in the heart of <a href=\"http://visitalexandriava.com/\">Old Town, Alexandria</a>.  Despite the morning rain, many people came and enjoyed the festival\'s first day.  Even though the day started out a bit wet, the sun was peaking out from the clouds by early afternoon.  We had a great day and hope to see you all tomorrow.  Weather should be great!','alexandriavolunteerbureau.jpg','2008-05-10','2008-05-10 23:47:07','2008-05-10 23:58:08'),(15,'McLean Day (05/17/2008)','We enjoyed a beautiful day in McLean\'s Lewinsville Park on Saturday celebrating <a href=\"http://www.mcleancenter.org/calendar/eventdetail.asp?eventid=333\">McLean Day</a>.  For the first time this season we didn\'t feel a drop of rain.  Thanks to all those who visited us to play and buy our puzzles.\r\n<p>Throughout the day we talked with quite a few people about how playing with puzzles effects a child\'s physical and mental development.  I found an interesting article at <a href=\"http://buzzle.com\">Buzzle.com</a> written by Barbara White in December of 2005 titled <a href=\"http://www.buzzle.com/editorials/12-12-2005-83737.asp\">The Value of Jigsaw Puzzles for Very Young Children</a>.  Among other things, Ms. White writes, \"Puzzles help develop the reasoning and deduction process of thinking. As well as skills such as spatial awareness, matching and sorting. Above all, jigsaw puzzles present a great opportunity for language development and a happy social interaction with your child.\"  ','mcleanday.jpg','2008-05-18','2008-05-19 13:42:48','2008-05-19 14:15:35'),(16,'KidSource.com Recommends Puzzles for Young Children (5/18/2008)','\"When children work on puzzles, they are actually \"putting the pieces together\" in more ways than one. Puzzles help children build the skills they need to read, write, solve problems, and coordinate their thoughts and actionsâ€”all of which they will use in school and beyond. Find a puzzle with a picture that has particular interest for your child, and you may help her begin to recognize colors and letters, and come to realize that the sum of parts make up a wholeâ€”a concept that will help her with math later on. By inserting pieces into the puzzle, children also develop the muscle group used for writing, or the \"pincer\" grasp. \r\n<P>Children can work on puzzles by themselves, without the help of adults or other children. They can also work together on large puzzles and practice compromising and getting along. Because each child must concentrate on the puzzle individually, he experiences a sense of satisfaction as he picks up a piece, rotates it, and discovers the spot in which it fits. Piece by piece, he begins to recognize the picture that the puzzle represents.\"  To read the full article, click <a href=\"http://www.kidsource.com/kidsource/content4/puzzles.early.child.html\">here</a>.\r\n\r\n\r\n\r\n','KIDSRCE_btn.gif','2008-05-19','2008-05-19 14:15:12','2008-05-19 14:18:59'),(17,'Children\'s Bookstore (5/20/2008)','We don\'t often have the opportunity to endorse other businesses but in this case we\'ll make an exception.  We recently discovered <a href=\"http://www.childrensbookstore.com\">www.childrensbookstore.com</a>.  Wow!  What a discovery!  <a href=\"http://www.childrensbookstore.com\">Children\'s Bookstore</a> has just about any book you could possibly want and the best prices I\'ve seen for a while.  It is also an online community where parents share information, get expert advice on raising children, and find fun activities that encourage children to read.  <a href=\"http://www.childrensbookstore.com\">Children\'s Bookstore</a> is a wonderful resource and we hope you all take a few moments to check it out.','childrensbookstore.jpg','2008-05-20','2008-05-20 17:06:24','2008-05-25 01:40:35'),(18,'Viva Vienna Sale (5/24/2008)','To celebrate <a href=\"http://www.vivavienna.org\">Viva Vienna 2008</a>, we\'ve decided to have a sale!  All puzzle have been reduced for a limited time to celebrate our involvement in the Viva Vienna Festival and to commemorate Memorial Day.  Our larger puzzles usually sell for $25 each.  During our Viva Vienna Sale, those puzzles will sell for only $19.95 online and $20 at the festival.  We\'re also having a shipping special.  Buy up to 5 puzzles and pay only $5 for shipping.  6 to 10 puzzles will only be $10.  We hope everyone has a happy Memorial Day weekend and that everyone in the National Capitol area will come on over to Vienna (<a href=\"http://www.vivaviennava.org/docs/vivamap2008.pdf\">Booth 143 on Church Street next to Great Harvest Bread</a>) and join us on Sunday and Monday at Viva Vienna!','Sale.jpg','2008-05-25','2008-05-25 00:49:38','2008-05-25 02:01:02'),(19,'May Drawing Winner (6/1/2008)','Congratulations to Steven C. from New Mexico.  Steven was the winner of the May Puzzle give-away.  Steven won a free Staci Sea Horse - Natural Stains.  Congratulations, Steven , we hope you enjoy your puzzle.  To register for next month\'s drawing, click <a href=\"http://mydaddypuzzles.com/puzzle/give_away\">here</a>.','seahorse_stained_thumb.jpg','2008-06-01','2008-06-01 14:28:13','2008-06-01 14:55:03'),(20,'Extension of the Viva Vienna Sale (6/1/2008)','Thanks to the awesome response we had to our Viva Vienna Sale, we\'ve decided to hold it over until July 1st.  All our puzzles are priced under $20 all month.  We\'ve also got a great shipping deal.  Any order of 1-5 puzzles will be shipped for a flat fee of $5.  That\'s a deal!  Thanks to everyone for making Viva Vienna such a great success.  We hope you all enjoy your puzzles.','sale_banner.jpg','2008-06-02','2008-06-02 00:06:53','2008-06-02 00:06:53'),(21,'Celebrate Fairfax (6/9/2008)','<a href=\"http://www.celebratefairfax.org/\">Celebrate Fairfax</a> was a bit of a trial for everyone involved.  It was so hot.  Those poor people waded through 105 degree heat for two days.  Let\'s say they were not too willing to take out their wallets to buy some awesome puzzles.  \r\n\r\nWe ended up having a great time anyway.  The booth next to ours was run by two very nice people from southern West Virginia, Willow and Ryan.  They run a business called <a href=\"http://willowsworldofjewels.com\">Willows World of Jewels</a>  They make some great looking stuff.  In fact, I bought one of their necklaces for my mother-in-law for Christmas.  (I sure hope Judy doesn\'t read this.)\r\n\r\nWillow and Ryan\'s website is not quite ready but you should all check it out when they get it up and running.  \r\n\r\n','celebrate fairfax.jpg','2008-06-10','2008-06-17 15:15:40','2008-06-17 15:15:40'),(22,'Coming Soon - Dorothy Dragon (6/17/2008)','We\'re pleased to announce that Dorothy Dragon will join our puzzle family this summer.  Dorothy is 11 inches wide and 7 inches tall.  She will be made out of maple.  We expect to have a Fun Colors Dorothy, a Green Dorothy, and a Red Dorothy.  Dorothy has 7 pieces.  Dorothy will be lots of fun and she\'ll be available in late July.','Dragon.jpg','2008-06-17','2008-06-17 15:23:29','2008-06-17 15:27:04'),(23,'Coming Soon - Timmy T-Rex (6/17/2008)','We\'re pleased to announce that Timmy T-Rex will join our puzzle family this summer.  Timmy is 10.5 inches wide and 7 inches tall.  He will be made out of maple.  We expect to have a Fun Colors Timmy and a Green Timmy.  Timmy has 8 pieces.  Timmy will be lots of fun and he\'ll be available in late July.','TRex.jpg','2008-06-17','2008-06-17 15:29:25','2008-06-17 15:34:24'),(24,'Comming Soon - Torrey Triceratops (6/17/2008)','We\'re pleased to announce that Torrey Triceratops will join our puzzle family this summer.  Torrey is 11 inches wide and 6 inches tall.  She will be made out of maple.  We expect to have a Fun Colors Torrey and a Green Torrey.  Torrey has 7 pieces.  Torrey will be lots of fun and she\'ll be available in late July.','Triceratops.jpg','2008-06-17','2008-06-17 15:33:47','2008-06-17 15:34:39'),(25,'Comming Soon - Ryan Racecar (6/17/2008)','We\'re pleased to announce that Ryan Racecar will join our puzzle family this summer.  Ryan is 11 inches wide and 4 inches tall.  He will be made out of maple.  We expect to have a Red Ryan , a Blue Ryan and a Fun Colors Ryan.  Ryan has 7 pieces.  Ryan will be lots of fun and he\'ll be available in late July.','Race Car.jpg','2008-06-17','2008-06-17 15:40:32','2008-06-17 15:40:32'),(26,'Art in the Park Sponsored by Cameron Perks (6/21/2008)','We were invited to a great event at <a href=\"http://www.cameronstation.org\">Cameron Station</a> in Alexandria.  Art in the Park was sponsored by <a href=\"http://www.cameronperks.com\">Cameron Perks</a> a wonderful coffeehouse on the main street in Cameron Station.  I highly recommend the lemon bars.  The weather was great and we met quite a few wonderful folks.  We had so much fun we\'re already looking forward to next year.\r\n\r\n\r\n\r\n\r\n','cameronperks.jpg','2008-06-21','2008-07-01 14:29:17','2008-07-01 14:31:29'),(28,'Reston Festival (7/13/2008)','Have you ever been to the <a href=\"http://www.restontowncenter.com\">Reston Town Center</a>?  Holy cow, that\'s a nice place.  It is huge but still has a very small town Main Street feel to it.  We spent the weekend in Reston at the <a href=\"http://www.restonfestival.com/index.asp\">44th Annual Reston Festival</a> and we had a great time.  I was a bit worried that it would be too hot but there was a very nice breeze all day.  Unfortunately, that nice breeze was not so nice on Saturday night.  I arrived on Sunday morning to find out canopy tent crumpled up in a heap in the alley behind our booth spot.  I guess a gust of wind came through and just picked it up and slammed it against the building.  We\'re pretty lucky.  There were 10 lb weights on each of the legs and they were thrown 30 feet down the alley.  I\'m just glad they didn\'t go through the huge windows.  Anyway, we had a great time.  Good weather, good people and a great time.  Once again, we had a great neighbor, <a href=\"http://www.hollylanedesigns.com/abouttheartist.html\">Tiffany Scott</a> of <a href=\"http://www.hollylanedesigns.com/\">Holly Lane Designs</a>.  She makes some great silver jewelry.  Check it out if you have time.  ','restonfestival.jpg','2008-07-13','2008-07-15 17:15:25','2008-07-15 17:23:31'),(29,'MyDaddyPuzzles at the Arlington County Fair (7/15/2008)','We\'ve been at the <a href=\"http://www.arlingtoncountyfair.org/\">Arlington County Fair</a> for the last four days.  We had a great time.  There were a lot of very nice people and some old craft show friends too.  I can do without another announcement of the piglet races but other than that we had a great time.  Thanks to everyone who stopped by the booth to chat and purchase our puzzles.  We hope to see everyone next year.','arlingtoncountyfair.jpg','2008-07-15','2008-07-15 17:23:06','2008-08-10 23:50:39'),(30,'New Puzzles added to MyDaddyPuzzles Lineup (8/21/2008)','We\'re very proud to announce that Timmy T-Rex, Torrey Triceratops, Ryan Race Car, and Dorothy Dragon have officially joined the MyDaddyPuzzles family.  Timmy, Ryan, Torrey and Dorothy are made of high quality, US grown soft maple.  Timmy, Ryan, and Torrey have been priced at $20.  Due to it\'s larger size, Dorothy is priced at $25.  Dorothy and Ryan are moving especially fast so get your orders in today!','Drago Blue thumb.jpg','2008-08-21','2008-08-21 20:06:39','2008-08-21 20:07:02');
