INSERT INTO `puzzles` VALUES (1,'Camden Camel','Camden is my favorite puzzle to make.  Camden is especially beautiful in his stained version.  He is made of solid poplar and has 9 pieces.  Camden is perfect for children age 4 and older.','7\" wide by 9\" high<br>3/4\" thick',1,2,0),(2,'Ollie Orca','Ollie is our most beautiful puzzle.  He is also made of solid poplar.  Ollie has 8 pieces and is a great puzzle for children ages 6 and older','10.5\" wide by 8\" high<br>3/4\" thick',1,33,0),(3,'Staci Sea Horse','Staci is one of our most entertaining puzzles.  Staci has 8 pieces and is made of solid poplar.  She is appropriate for children ages 5 and older.',' 6\" wide by 10.5\" high<br>3/4\" thick',1,6,0),(4,'Logan Lion','Logan was inspired by Rembrandt\'s drawing.  He has 8 pieces and is made of solid poplar.  Children ages 4 and older will have lot of fun with Logan.','12\" wide by 5.5\" high<br>3/4\" thick',1,29,0),(5,'Annie Alligator','We love Annie. She is made of solid poplar and has 8 pieces.  Annie is appropriate for a child ages 3 and older.','12.5\" wide by 8\" tall<br>3/4\" thick',1,30,0),(6,'Belinda Butterfly','Belinda is unique because her two wings are identical.  Pieces can be interchanged.  She\'s made of solid poplar and has 9 pieces.  Children age 4 and older will love her.  Belinda is especially popular with the little girls.',' 7\" wide by 9\" high<br>3/4\" thick',1,10,0),(7,'Faye Fish','Faye Fish started it all.  Faye was our first puzzle asnd is still our favorite.  Faye has 9 pieces, made of solid poplar, and is appropriate for children ages 5 and up.','12\" wide by 5\" high<br>3/4\" thick',1,39,0),(8,'Danny Duckling','Danny is a great intermediate puzzle.  Children age 3 and older can easily complete this puzzle.  Danny has 7 pieces and is made of solid poplar.','9\" wide by 7\" high<br>3/4\" thick',1,13,0),(9,'Lambert Lamb','Lambert is our most popular puzzle.  Children as young as 2 enjoy playing with him.  Like all our other puzzles, Lambert is made of solid poplar.  He has 5 pieces.','6.5\" wide by 6.5\" high<br>3/4\" thick',1,41,0),(10,'Freddy Froggy','Freddy is one of our more challenging puzzles. He has 10 pieces and is made of solid poplar.  Freddy would be appropriate for a child ages 4 and older.','7\" wide by 9\" high<br>3/4\" thick',1,NULL,0),(11,'Ryan Race Car','Ryan is the first puzzle we\'ve made that isn\'t based on a animal.  He was a special request of our youngest son.  He\'s made of solid maple and has 7 pieces.  Annie is appropriate for a child ages 3 and older.<p style=\"color: #ff0000;font-weight:bold;\">NEW ADDITION<br></p>','11\" wide by 4 1/4\" high<br> 3/4\" thick',1,48,1),(12,'Dorothy Dragon','Dorthy is made of solid maple.  She\'s a more difficult puzzle but very popular.  She has seven pieces.  Annie is appropriate for a child ages 5 and older.<p style=\"color: #ff0000;font-weight:bold;\">NEW ADDITION<br></p>','11\" wide by 7 1/2\" high<br>3/4\" thick',1,50,1),(13,'Timmy T-Rex','Timmy is the result of many requests for dinosaur puzzles.  He is made of solid maple and has 7 pieces.  Timmy is appropriate for a child ages 4 and older.<p style=\"color: #ff0000;font-weight:bold;\">NEW ADDITION<br></p>','11\" wide by 7\" high<br>3/4\" thick',1,51,1),(14,'Torrey Triceratops','We couldn\'t have Timmy without Torrey. She is made of solid maple and has 7 pieces.  Torrey is appropriate for a child ages 4 and older.<p style=\"color: #ff0000;font-weight:bold;\">NEW ADDITION<br></p>','11\" wide by 6\" high<br>3/4\" thick',1,52,1);
